import React from "react";
import { List, Icon } from "semantic-ui-react";

const TodoList = () => {
  return (
    <div className="todo-container border">
        <div className="reminder-header">
            <h4>Reminder</h4>
            <Icon name="user" />
        </div>

      <List>
        <List.Item className="reminder-item">
          <List.Icon name="check" color="green" size="normal" />
          <List.Content className="check">Signing new business plan <span className="time-reminder">5 days</span></List.Content>
        </List.Item>

        <List.Item>
          <List.Icon name="cancel" color="red" size="normal" />
          <List.Content>Signing new business plan</List.Content>
        </List.Item>
      </List>
    </div>
  );
};

export default TodoList;
